  private def  zlibZip(primStr:String):String = {
    if (primStr == null || primStr.length () == 0) {
      return primStr
    }
    val out = new ByteArrayOutputStream ()
    val gzip = new DeflaterOutputStream (out)
    try {
      gzip.write (primStr.getBytes())
    } catch {
      case e: Exception => e.printStackTrace ();
    } finally {
      if (gzip != null) {
        try {
          gzip.close ()
        } catch {
          case e: Exception => e.printStackTrace ();
        }
      }
    }
    new sun.misc.BASE64Encoder().encode(out.toByteArray)
  }


  /*
  KMP 字符匹配算法
   */
  private def get_next(t:String,t_len:Int,next:Array[Int]):Unit = {
    var i   = 0
    var  j   = -1
    next(0) = -1
    while( i < t_len )
    {
      if(j == -1 || t(i) == t(j) ) {
        i = i + 1
        j = j + 1
        if(i  < t_len) {
          if(t(i) != t(j))
            next(i) = j
          else
            next(i) = next(j)
        }
      }
      else
        j = next(j)
    }
  }

  private def index_op(s:String,t:String,pos:Int) : Int = {
    val s_len = s.length
    val t_len = t.length

    if( t_len > s_len )
      return -1
    var next = new Array[Int](t_len)
    next = new Array[Int](t_len)
    get_next(t,t_len,next)

    /*开始匹配*/
    var i = pos
    var  j = 0
    while(i < s_len && j < t_len ) {
      if(j == -1 || s(i) == t(j) ) {
        i = i + 1
        j = j + 1
      }
      else {
        j = next(j)
      }
    }
    /*返回结果*/
    if( j == t_len )
      i - t_len
    else
      -1
  }
